E_C("CREATE TABLE `ecs_users` (
  `user_id` mediumint(12) unsigned NOT NULL AUTO_INCREMENT,
  `user_majid` int(12) NOT NULL DEFAULT '-1' COMMENT 'majID',
  `email` varchar(60) NOT NULL DEFAULT '',
  `user_name` varchar(60) NOT NULL DEFAULT '',
  `password` varchar(32) NOT NULL DEFAULT '',
  `question` varchar(255) NOT NULL DEFAULT '',
  `answer` varchar(255) NOT NULL DEFAULT '',
  `sex` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别',
  `birthday` date NOT NULL DEFAULT '0000-00-00' COMMENT '出生日期',
  `user_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '主账户',
  `frozen_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '冻结账户',
  `user_subsidiarymoney` decimal(10,2) DEFAULT '0.00' COMMENT '附属账户',
  `user_jpymoney` decimal(10,2) DEFAULT '0.00' COMMENT '日元账户',
  `pay_points` int(10) unsigned NOT NULL DEFAULT '0',
  `rank_points` int(10) unsigned NOT NULL DEFAULT '0',
  `address_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `reg_time` int(12) unsigned NOT NULL DEFAULT '0',
  `last_login` int(12) unsigned NOT NULL DEFAULT '0',
  `last_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `last_ip` varchar(15) NOT NULL DEFAULT '',
  `visit_count` smallint(5) unsigned NOT NULL DEFAULT '0',
  `user_rank` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `is_special` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `ec_salt` varchar(10) DEFAULT NULL,
  `salt` varchar(10) NOT NULL DEFAULT '0',
  `parent_id` mediumint(9) NOT NULL DEFAULT '0',
  `flag` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `alias` varchar(60) NOT NULL,
  `msn` varchar(60) NOT NULL,
  `qq` varchar(20) NOT NULL,
  `office_phone` varchar(20) NOT NULL,
  `home_phone` varchar(20) NOT NULL,
  `mobile_phone` varchar(20) NOT NULL,
  `is_validated` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `credit_line` decimal(10,2) unsigned NOT NULL,
  `passwd_question` varchar(50) DEFAULT NULL,
  `passwd_answer` varchar(255) DEFAULT NULL,
  `recommend_code` varchar(50) DEFAULT NULL COMMENT '推荐码',
  `reg_ip` varchar(30) DEFAULT NULL,
  `storage_code` varchar(50) DEFAULT NULL COMMENT '入库码',
  `refencer_recommend_code` varchar(50) DEFAULT '' COMMENT '介绍人-推荐码',
  `isdelete` tinyint(4) DEFAULT '0',
  `user_identitycard` varchar(50) DEFAULT NULL COMMENT '身份证号',
  `user_country` int(12) DEFAULT NULL COMMENT '国家',
  `user_province` int(12) DEFAULT NULL COMMENT '省',
  `user_city` int(12) DEFAULT NULL COMMENT '城市',
  `user_address` varchar(500) DEFAULT NULL COMMENT '地址',
  `user_zipcode` varchar(10) DEFAULT NULL COMMENT '邮政编码',
  `user_taobaowangwang` varchar(50) DEFAULT NULL COMMENT '淘宝旺旺',
  `user_wechat` varchar(50) DEFAULT NULL COMMENT '微信',
  `user_remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `user_isperfect` tinyint(4) DEFAULT NULL COMMENT '信息是否完整',
  `user_warehouseid` int(12) DEFAULT '0' COMMENT '默认仓库',
  `user_headsculpture` varchar(500) DEFAULT NULL COMMENT '头像',
  `user_storage_code` varchar(50) DEFAULT '' COMMENT '同storage_code，4位长度',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `user_name` (`user_name`),
  KEY `email` (`email`),
  KEY `parent_id` (`parent_id`),
  KEY `flag` (`flag`),
  KEY `user_majid` (`user_majid`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=31709 DEFAULT CHARSET=utf8");
